import React from "react";
import "./App.css";

class App extends React.Component {
  render() {
    return (
      <div>
        {app_logo}{searchBox};{App_Btn}
      </div>
    );
  }
}

class app_logo extends React.Component {
  render() {
    return (
      <div>
        <h1>카 고</h1>
        <h6>주변 카페 자리를 확인해보세요~</h6>
      </div>
    );
  }
}

class searchBox extends React.Component {
  render() {
    return (
      <div>
        <input id="search" type="search"></input>
        <input id="searchBtn" type="submit" value="검색"></input>
      </div>
    );
  }
}

class App_Btn extends React.Component {
  render() {
    return (
      <div>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          현재 위치로 확인
        </a>
      </div>
    );
  }
}

export default App;
